import { createImageList } from "../../../functions/createImageList";

var photos: string[] = [
  "./IMG_3407.jpg",
  "./IMG_3407.jpg",
  "./IMG_3407.jpg",
  "./IMG_3407.jpg",
  "./IMG_3407.jpg",
];

// export default images2016;

createImageList(photos);

const newImages = [
  { id: 1, src: require("./IMG_3407.jpg"), col: 2, title: "Fin" },
  { id: 2, src: require("./IMG_3407.jpg"), col: 3, title: "Fin" },
  { id: 3, src: require("./IMG_3407.jpg"), col: 1, title: "Fin" },
  { id: 4, src: require("./IMG_3407.jpg"), col: 2, title: "Fin" },
  { id: 5, src: require("./IMG_3407.jpg"), col: 3, title: "Fin" },
];
export default newImages;
